<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Standard Time Lookup</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap" rel="stylesheet">
    <!-- Barcode Scanner Library -->
    <script src="https://unpkg.com/html5-qrcode@2.3.8/html5-qrcode.min.js"></script>
    <style>
        body { font-family: 'Inter', sans-serif; }
        .result-card {
            box-shadow: 0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05);
            transition: transform 0.2s ease-in-out;
        }
        .result-card:hover {
            transform: translateY(-5px);
        }
        #scanner-modal {
            background-color: rgba(0,0,0,0.5);
        }
    </style>
</head>
<body class="bg-gray-50 text-gray-800 flex items-center justify-center min-h-screen">

    <div class="w-full max-w-4xl mx-auto p-4 md:p-8">
        <div class="bg-white rounded-xl shadow-lg p-6 md:p-8">
            <div class="flex items-center mb-6">
                <div class="bg-blue-500 text-white rounded-full p-3 mr-4">
                    <svg xmlns="http://www.w3.org/2000/svg" class="h-8 w-8" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" /></svg>
                </div>
                <div>
                    <h1 class="text-2xl md:text-3xl font-bold text-gray-900">Standard Time Lookup Tool</h1>
                    <p class="text-gray-500 mt-1">Enter a Work Order to find standard run times for operations.</p>
                </div>
            </div>
            
            <div id="main-content" class="grid grid-cols-1 md:grid-cols-3 gap-6">
                <!-- Input Controls -->
                <div class="md:col-span-1 bg-gray-50 p-6 rounded-lg border">
                    <h2 class="text-lg font-semibold mb-4">Query Parameters</h2>
                    <div class="space-y-4">
                        <div>
                            <label for="wo-input" class="block text-sm font-medium text-gray-700 mb-1">Work Order #</label>
                            <div class="flex items-center space-x-2">
                                <input type="text" id="wo-input" placeholder="e.g., 20181492" class="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500">
                                <button id="scan-btn" class="p-2 bg-blue-500 text-white rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500">
                                    <svg xmlns="http://www.w3.org/2000/svg" class="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 4v16m8-8H4" /></svg>
                                </button>
                            </div>
                        </div>
                        <div>
                            <label for="op-input" class="block text-sm font-medium text-gray-700 mb-1">Operation #</label>
                            <select id="op-input" class="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 bg-gray-200" disabled>
                                <option>Enter WO first</option>
                            </select>
                        </div>
                    </div>
                </div>

                <!-- Results Display -->
                <div class="md:col-span-2 p-6 rounded-lg">
                     <h2 class="text-lg font-semibold mb-4">Result</h2>
                     <div id="result-display" class="result-card bg-white p-8 rounded-xl border border-gray-200 text-center flex flex-col items-center justify-center h-full">
                        <p id="item-number-display" class="text-gray-500 font-medium mb-2">Awaiting input...</p>
                        <p id="time-display" class="text-6xl font-bold text-blue-600">-</p>
                        <p class="text-gray-500 font-medium mt-2">Standard Run Time (minutes)</p>
                     </div>
                </div>
            </div>
        </div>
         <p class="text-center text-xs text-gray-400 mt-4">This tool uses a pre-prepared data file. Data is current as of the last update.</p>
    </div>

    <!-- Scanner Modal -->
    <div id="scanner-modal" class="fixed inset-0 z-50 items-center justify-center hidden">
        <div class="bg-white rounded-lg shadow-xl p-4 w-full max-w-md m-4">
            <h3 class="text-lg font-medium text-gray-900 mb-2">Scan Work Order Barcode</h3>
            <div id="qr-reader" style="width: 100%;"></div>
            <button id="close-scanner-btn" class="mt-4 w-full bg-red-500 text-white py-2 rounded-md hover:bg-red-600">Cancel</button>
        </div>
    </div>

},{"order_number":"21408160","item_number":"TP-8122-299-6002-6D-967","operation_number":20,"run_time":341.83},{"order_number":"21408160","item_number":"TP-8122-299-6002-6D-967","operation_number":30,"run_time":8},{"order_number":"21408160","item_number":"TP-8122-299-6002-6D-967","operation_number":40,"run_time":22.5}];

        document.addEventListener('DOMContentLoaded', () => {
            const woInput = document.getElementById('wo-input');
            const opInput = document.getElementById('op-input');
            const itemNumberDisplay = document.getElementById('item-number-display');
            const timeDisplay = document.getElementById('time-display');
            const scanBtn = document.getElementById('scan-btn');
            const scannerModal = document.getElementById('scanner-modal');
            const closeScannerBtn = document.getElementById('close-scanner-btn');

            if (typeof masterData === 'undefined' || masterData.length === 0) {
                document.getElementById('main-content').innerHTML = `<div class="col-span-3 text-center p-4 bg-red-100 rounded-lg text-red-700 font-medium">FATAL ERROR: Data is missing or was not loaded correctly.</div>`;
                return; 
            }

            // --- Barcode Scanner Logic ---
            const html5QrCode = new Html5Qrcode("qr-reader");

            const qrCodeSuccessCallback = (decodedText, decodedResult) => {
                woInput.value = decodedText;
                // Manually trigger the 'input' event to update the UI
                woInput.dispatchEvent(new Event('input', { bubbles: true }));
                stopScanner();
            };

            const config = { fps: 10, qrbox: { width: 250, height: 250 } };

            function startScanner() {
                scannerModal.classList.remove('hidden');
                scannerModal.classList.add('flex');
                // Use the 'environment' facing camera
                html5QrCode.start({ facingMode: "environment" }, config, qrCodeSuccessCallback)
                    .catch(err => console.log(`Unable to start scanner: ${err}`));
            }

            function stopScanner() {
                html5QrCode.stop().then(ignore => {
                    scannerModal.classList.add('hidden');
                    scannerModal.classList.remove('flex');
                }).catch(err => console.log("Failed to stop scanner cleanly."));
            }

            scanBtn.addEventListener('click', startScanner);
            closeScannerBtn.addEventListener('click', stopScanner);
            // --- End of Barcode Scanner Logic ---


            woInput.addEventListener('input', () => {
                const wo = woInput.value.trim();
                resetResult();
                opInput.innerHTML = ''; 

                if (wo.length > 0) {
                    const relevantOps = masterData
                        .filter(row => row.order_number == wo)
                        .map(row => row.operation_number);

                    const uniqueOps = [...new Set(relevantOps)].sort((a, b) => a - b);
                    
                    if (uniqueOps.length > 0) {
                        opInput.disabled = false;
                        opInput.classList.remove('bg-gray-200');
                        opInput.innerHTML = '<option value="">Select an operation...</option>';
                        uniqueOps.forEach(op => {
                            const option = document.createElement('option');
                            option.value = op;
                            option.textContent = op;
                            opInput.appendChild(option);
                        });
                        
                        const firstRecord = masterData.find(row => row.order_number == wo);
                        if(firstRecord) {
                            itemNumberDisplay.textContent = `Item Number: ${firstRecord.item_number}`;
                        }
                    } else {
                        disableOpInput('No operations found');
                    }
                } else {
                    disableOpInput('Enter WO first');
                }
            });
            
            opInput.addEventListener('change', () => {
                const wo = woInput.value.trim();
                const op = opInput.value;
                
                if (wo && op) {
                    const result = masterData.find(row => row.order_number == wo && row.operation_number == op);
                    if (result) {
                        timeDisplay.textContent = result.run_time;
                    } else {
                        timeDisplay.textContent = '-';
                    }
                } else {
                    timeDisplay.textContent = '-';
                }
            });

            function disableOpInput(message) {
                opInput.disabled = true;
                opInput.classList.add('bg-gray-200');
                opInput.innerHTML = `<option>${message}</option>`;
            }

            function resetResult() {
                itemNumberDisplay.textContent = 'Awaiting input...';
                timeDisplay.textContent = '-';
            }
        });
    </script>
